import React from "react";
import { AppBar, Toolbar, Typography } from "@mui/material";

const Navbar = () => {
    return(
        <>
            <AppBar>
                <Toolbar>
                    <Typography>Menu</Typography>
                    <img src={require('../images/logo.png')} width="100"/>
                </Toolbar>
            </AppBar>
        </>
        );
}

export default Navbar;
